import * as React from 'react';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import CssBaseline from '@mui/material/CssBaseline';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';
import GroupExample from '../LatestNews/LatestNews';
import LoanAdvice from '../LoanAdvice/LoanAdvice';
import GroupExampleF from '../FinancialContent/FinancialContent';
import BankingSuggestions from '../BankingSuggestions/BankingSuggestions';
import Button from '@mui/material/Button';
const drawerWidth = 240;

export default function PermanentDrawerLeft() {
  return (
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar
        position="fixed"
        sx={{ width: `calc(100% - ${drawerWidth}px)`, ml: `${drawerWidth}px` }}
      >
        <Toolbar>
          <Typography variant="h6" noWrap component="div">
            Latest News
          </Typography>
        </Toolbar>
      </AppBar>
      
      <Drawer
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
          },
        }}
        variant="permanent"
        anchor="left"
      >
        <Toolbar />
        <Divider />
        <List>
          {['Home', 'Latest News', 'Get Advice', 'Get Your Ease'].map((text, index) => (
            <ListItem key={text} disablePadding>
              <ListItemButton>
                <ListItemIcon>
                  {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
                </ListItemIcon>
                <ListItemText primary={text} />
              </ListItemButton>
            </ListItem>
          ))}
        </List>
        <Divider />
        <List>
          {['Settings', 'Logout' ].map((text, index) => (
            <ListItem key={text} disablePadding>
              <ListItemButton>
                <ListItemIcon>
                  {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
                </ListItemIcon>
                <ListItemText primary={text} />
              </ListItemButton>
            </ListItem>
          ))}
        </List>
      </Drawer>
      <Box
        component="main"
        sx={{ flexGrow: 1, bgcolor: 'background.default', p: 3 }}
      >
        <Toolbar />

        <Typography paragraph>
        Lorem ipsum, or lipsum as it is sometimes known 
        </Typography>
        <Typography paragraph>
        Apply For A Loan Or Scholarship
        </Typography>

        <Button variant="contained" color="success">
            Our Services 
        </Button>
<br/><br/><br/>
        <Typography paragraph>
          
          Product Description
        </Typography>
       <GroupExample />
       <Typography paragraph>
          Loan Advice
        </Typography>
       <LoanAdvice />
       <Typography paragraph>
          Financial Content
        </Typography>
       <GroupExampleF/>
       <Typography paragraph>
          Banking Suggestions
        </Typography>
       <BankingSuggestions/>

      </Box>
    </Box>
  );
}
